('node', 'page', 0, 1, 1, 'und', 0, '<html >\r\n\r\n <head>\r\n\r\n  <meta http-equiv="Content-Type" content="text/html" charset="windows-1251" />\r\n\r\n  <link rel="stylesheet" type="text/css" href="style.css">\r\n\r\n  <script type="text/javascript" src="vverh.js"></script>\r\n\r\n  <script type="text/javascript" src="naverh.js"></script>\r\n\r\n  <script type="text/javascript" src="script.js"></script>\r\n\r\n    <script type="text/javascript" src="news.js"></script>  \r\n\r\n	<script type="text/javascript" src="news1.js"></script>\r\n\r\n  <title>Автосалон AlexCar</title>\r\n\r\n </head>\r\n\r\n  <body>\r\n\r\n    <div id="container">\r\n\r\n<img src="image/sapka.jpg" width="100%">\r\n\r\n	 <div id="sidebar">\r\n\r\n	 	<p><a onclick="window.open(''http://player.online.fm/ru/dfm'',''_blank'',''width=430,height=440,resizable=0'');return false;" href="javascript:void(0);"><img src="image/radio.png"></a>\r\n\r\n	<h3>Содержание</h3>\r\n\r\n		 <a href="#1">Автомобиль</a>\r\n\r\n		 <br><a href="#2">Классификация</a>\r\n\r\n		 <br><a href="#3">История</a>\r\n\r\n		 <br><a href="#4">Рекорды скорости</a> \r\n\r\n		 <br>\r\n\r\n		 <br>\r\n\r\n <center><embed src="http://oyama-do.my1.ru/SWF/calendar.swf" width="160" height="200" wmode="transparent" type="application/x-shockwave-flash"></embed></center>		 \r\n\r\n<p><!--  START: Curs.md Widget HTML 1.0--><script language="JavaScript" type="text/javascript" src="http://curs.md/ru/curs_provider/000000/160/5e5e5e"></script><noscript><a href="http://curs.md/ru" target="_blank"><strong>curs.md</strong></a></noscript><!--  END: Curs.md Widget HTML 1.0-->\r\n\r\n<p><table cellpadding=0 cellspacing=0 width=160 style="border:solid 1px #000000;font-family:Arial;font-size:10px;background-color:#adadad"><tr><td><table width=100% cellpadding=0 cellspacing=0><tr><td width=8 height=30 background="http://rp5.md/informer/htmlinfa/topshl.png"  bgcolor=#000000> </td><td width=* align=center background="http://rp5.md/informer/htmlinfa/topsh.png" bgcolor=#000000><a style="color:#ffffff; font-family:Arial;font-size: 12px;" href="http://rp5.md/9854/ru"><b>Кишинев</b></a></td><td width=8 height=30 background="http://rp5.md/informer/htmlinfa/topshr.png" bgcolor=#000000> </td></tr></table></td></tr><tr><td valign=top style="padding:0;"><iframe src="http://rp5.md/htmla.php?id=9854&lang=ru&um=00000&bg=%23adadad&ft=%23ffffff&fc=%23000000&c=%23000000&f=Arial&s=10&sc=3" width=100% height=210 frameborder=0 scrolling=no style="margin:0;"></iframe></td></tr></table>\r\n\r\n	</div>	\r\n\r\n  <div id="content">\r\n\r\n<ul class="menu" id="menu">\r\n\r\n    <li><a href="index.html" class="menulink">Главная</a>\r\n\r\n	  <ul><li><a href="reg.php">Подписка на новости</a></li></ul></li>\r\n\r\n    <li><a href="index_pr.html" class="menulink"><img src="1.jpg">Porsche</a> \r\n\r\n      <ul> \r\n\r\n        <li><a href="pr_box.html">Boxster</a></li> \r\n\r\n        <li><a href="pr_caym.html">Cayman</a></li> \r\n\r\n        <li><a href="pr_911.html">911</a></li> \r\n\r\n	<li><a href="pr_pan.html">Panamera</a></li> \r\n\r\n	<li><a href="pr-cay.html">Cayenne</a></li> \r\n\r\n      </ul> \r\n\r\n    </li> \r\n\r\n    <li><a href="index_sk.html" class="menulink"><img src="3.png">SKODA</a> \r\n\r\n      <ul> \r\n\r\n    <li><a href="sk_fab.html">Fabia</a></li> \r\n\r\n    <li><a href="sk_roo.html">Roomster</a></li> \r\n\r\n    <li><a href="sk_oct.html">Octavia</a></li> \r\n\r\n	<li><a href="sk_yet.html">Yeti</a></li> \r\n\r\n	<li><a href="sk_sup.html">Superb</a></li> \r\n\r\n      </ul> \r\n\r\n    </li>\r\n\r\n	<li><a href="index_vw.html" class="menulink"><img src="2.png">Volkswagen </a> \r\n\r\n      <ul> \r\n\r\n        <li><a href="vw_pol.html">Polo</a></li> \r\n\r\n        <li><a href="vw_gol.html">Golf</a></li> \r\n\r\n        <li><a href="vw_sci.html">Scirocco</a></li> \r\n\r\n        <li><a href="vw_jet.html">Jetta</a></li> \r\n\r\n        <li><a href="vw_pasC.html">Passat CC</a></li> \r\n\r\n	<li><a href="vw_pas.html">Passat</a></li>\r\n\r\n	<li><a href="vw_tig.html">Новый Tiguan</a></li>\r\n\r\n	<li><a href="vw_tou.html">Touareg</a></li>\r\n\r\n      </ul> \r\n\r\n    </li>\r\n\r\n<li><a href="index_ja.html" class="menulink"><img src="4.png">JAGUAR</a> \r\n\r\n      <ul> \r\n\r\n        <li><a href="ja_xj.html">XJ LUXURY</a></li> \r\n\r\n        <li><a href="ja_xk.html">XK PORTFOLIO</a></li> \r\n\r\n        <li><a href="ja_xf.html">XF LUXURY</a></li>  \r\n\r\n      </ul> \r\n\r\n    </li>	\r\n\r\n  </ul>\r\n\r\n  </div>\r\n\r\n   <div id="content1">\r\n\r\n<b><a name="1">Автомобиль</a></b> (от др.-греч. <i>auto</i> — сам и лат. <i>mobilis</i> — движущийся), автомашина — самоходное безрельсовое транспортное средство, предназначенное для передвижения по суше.\r\n\r\n<p>Механическое транспортное средство, используемое обычно для перевозки по дорогам людей или грузов или для буксировки по дорогам транспортных средств, используемых для перевозки людей или грузов. Этот термин охватывает троллейбусы, то есть нерельсовые транспортные средства, соединённые с электрическим проводом; он не охватывает такие транспортные средства, как сельскохозяйственные тракторы, использование которых для перевозки людей или грузов является лишь вспомогательной функцией.\r\n\r\n<p align="right">— ст. 1 Конвенции о дорожном движении (Вена, 8 ноября 1968 года.)\r\n\r\n<p>Любое механическое самоходное транспортное средство, используемое обычно для перевозки по дорогам людей или грузов или для буксировки по дорогам транспортных средств, используемых для перевозки людей или грузов; этот термин не включает сельскохозяйственные тракторы" (Ст.1, Европейское соглашение, касающееся работы экипажей транспортных средств, производящих международные автомобильные перевозки (ЕСТР).\r\n\r\n<p align="right">— Женева, 1 июля 1970 года)\r\n\r\n<p>Наземное транспортное средство, продвигаемое его собственными средствами, движущееся по крайней мере на четырёх колесах, не находящихся на одной линии, которые должны всегда быть в контакте с землей; управление должно быть обеспечено по крайней мере двумя из колес, и движение — по крайней мере двумя из колес.\r\n\r\n<p align="right">— Международный спортивный кодекс ФИА, ст. 13\r\n\r\n<h2><a name="2">Классификация</a></h2> \r\n\r\n<menu>\r\n\r\n<li>Легковой автомобиль — полной массой не более 3500 кг для перевозки пассажиров (от 1 до 7, не включая водителя) и багажа. Легковые автомобили выпускаются с закрытыми кузовами (седан, лимузин, купе, хэтчбек, универсал и фургон) и с кузовами, верх которых убирается (кабриолет, родстер, ландо и фаэтон).</li>\r\n\r\n<li>Грузовой автомобиль (грузовик) — автомобиль для перевозки грузов. На грузовых шасси выпускают также автомобили специализированного и специального назначения.\r\n\r\n<li>Автомобиль особо большой грузоподъёмности —(другое название)фура автомобиль, автопоезд или другое автотранспортное средство, нагрузки на ось которого превышают 120 кН (12 тонн силы), а габарит по ширине — более 2,5 м.</li>\r\n\r\n<li>Автомобиль повышенной проходимости — легковой или грузовой автомобиль с приводом более чем на одну ось (или с ведущей одной осью, но возможностью блокировки осевого дифференциала), приспособленный для передвижения вне дорог с твёрдым покрытием. Автомобили повышенной проходимости оснащают трансмиссиями с расширенным диапазоном передаточных чисел, а также шинами со специальным рисунком протектора, часто с централизованной регулировкой давления в шинах и прочими техническими особенностями.\r\n\r\n<li>Внедорожник — легковой автомобиль, приспособленный для передвижения вне дорог. Имеют привод на все колёса, с принудительными блокировками (или жёстким включением) межосевых и межколёсных дифференциалов, повышенным клиренсом, шины со специальным рисунком протектора, расширенный ряд передаточных чисел трансмиссии и прочие технические особенности.\r\n\r\n<li>Вседорожник — легковой автомобиль, приспособленный для передвижения по дорогам всех типов, в том числе без твердого покрытия (грунтовым и полевым). Вседорожники обычно характеризуются приводом на все колёса, повышенным клиренсом.\r\n\r\n<li>Багги — лёгкий внедорожник для езды по песку. Обычно имеет открытую рамную конструкцию.\r\n\r\n<li>Пикап — грузопассажирская модификация на базе легкового автомобиля или вседорожника с открытой платформой с задним откидным бортом. Грузоподъёмность от 150 до 4500 кг.\r\n\r\n<li>Плавающий автомобиль (автомобиль-амфибия)\r\n\r\n<li>Летающий автомобиль\r\n\r\n<li>Спортивный автомобиль — автомобиль имеющий высокие скоростные качества, повышенную мощность мотора и низкую посадку кузова.\r\n\r\n<li>Гоночный автомобиль — автомобиль, созданный специально для спортивных соревнований.\r\n\r\n<li>Рекордно-гоночный автомобиль — автомобиль, созданный специально для установления рекордов для автомобилей (обычно на специальной трассе, без конкурирующих автомобилей, исключительно по секундомеру).\r\n\r\n<li>Автобус — автомобиль для перевозки более 8 пассажиров, не являющийся троллейбусом.\r\n\r\n<li>Троллейбус — автомобиль, предназначенный для перевозки более 8 пассажиров, с питанием электроэнергией от внешнего контактного провода.\r\n\r\n<p><h4>По типу двигателя:</h4>\r\n\r\n<li>Паровой\r\n\r\n<li>Бензиновый\r\n\r\n<li>Дизельный\r\n\r\n<li>Газовый\r\n\r\n<li>Газогенераторный\r\n\r\n<li>Водородный\r\n\r\n<li>Электромобиль — использующий для движения электрическую энергию собственных аккумуляторных батарей.\r\n\r\n<li>Гибридный автомобиль — автомобиль, использующий одновременно и электрический, и традиционный двигатель внутреннего сгорания.\r\n\r\n<p><h4>Автомобили специального назначения (колёсные):</h4>\r\n\r\n<img src="image/car.png" width="40%" align="right"> \r\n\r\n<p>гражданского назначения\r\n\r\n<li>тягач\r\n\r\n<li>карета скорой помощи\r\n\r\n<li>катафалк (транспорт)\r\n\r\n<li>снегоочиститель\r\n\r\n<li>автокран\r\n\r\n<li>автовышка\r\n\r\n<li>пожарный автомобиль\r\n\r\n<p>военного назначения\r\n\r\n<li>бронеавтомобиль\r\n\r\n<li>бронетранспортёр\r\n\r\n<h4>Автомобили специализированные(колёсные):</h4>\r\n\r\n<p>гражданского назначения\r\n\r\n<li>авторефрижератор\r\n\r\n<li>автоцистерна\r\n\r\n</menu>\r\n\r\n<p><h2><a name="3">История</a></h2>\r\n\r\n\r\n\r\n<p>Первые известные чертежи автомобиля (с пружинным приводом) принадлежатЛеонардо да Винчи (стр. 812R Codex Atlanticus), однако ни действующего экземпляра, ни сведений о его существовании до наших дней не дошло. В 2004 году эксперты Музея истории науки из Флоренции смогли восстановить по чертежам этот автомобиль, доказав тем самым правильность идеи Леонардо. В эпоху Возрождения и позже в ряде европейских стран «самодвижущиеся» тележки и экипажи с пружинным двигателем строились в единичных количествах для участия в маскарадах и парадах.\r\n\r\nВ 1769 году французский изобретатель Кюньо испытал первый образец машины с паровым двигателем[2], известный как «малая телега Кюньо», а в 1770 году — «большую телегу Кюньо». Сам изобретатель назвал её «Огненная телега» — она предназначалась для буксировки артиллерийских орудий.\r\n\r\n«Тележку Кюньо» считают предшественницей не только автомобиля, но и паровоза, поскольку она приводилась в движение силой пара. В XIX веке дилижансы на паровой тяге и рутьеры (паровые тягачи, то есть безрельсовые паровозы) для обычных дорог строились в Англии, Франции и применялись в ряде европейских стран, включая Россию, однако они были тяжёлыми, прожорливыми и неудобными, поэтому широкого распространения не получили. В 1791 году русским изобретателем Иваном Кулибиным была изготовлена «самокатная повозка».\r\n\r\nБыли отдельные случаи построения легковых автомобилей как предметов роскоши. Так, в историю вошёл La Marquise (официальное название — De Dion-Bouton et Trepardoux), построенный в 1884 году и работавший на паровой тяге.\r\n\r\nПоявление лёгкого, компактного и достаточно мощного двигателя внутреннего сгорания открыло широкие возможности для развития автомобиля. В 1885 году немецкий изобретатель Г. Даймлер, а в 1886 году его соотечественник К. Бенц изготовили и запатентовали первые самодвижущиеся экипажи с бензиновыми двигателями. В 1895 году К. Бенц изготовил первый автобус с ДВС. В 1896 году Г. Даймлер изготовил первое такси и грузовик. В последнем десятилетии XIX века в Германии, Франции и Англии зародилась автомобильная промышленность.\r\n\r\nВ первой четверти XX века широкое распространение получили электромобили и автомобили с паровой машиной. В 1900 году примерно половина автомобилей в США была на паровом ходу, в 1910-х в Нью-Йорке в такси работало до 70 тыс. электромобилей.\r\n\r\nВ том же 1900 году Фердинанд Порше сконструировал электромобиль с четырьмя ведущими колёсами, в которых располагались приводящие их в движение электродвигатели. Через два года голландская фирма Spyker выпустила гоночный автомобиль с полным приводом, оснащённый межосевым дифференциалом[3].\r\n\r\nВ 1906 году паровой автомобиль фирмы Stanley установил рекорд скорости — 203 км/ч. Модель 1907 года проезжала на одной заправке водой 50 миль. Необходимое для движения давление пара достигалось за 10-15 минут от запуска машины. Это были любимые машины полицейских и пожарных Новой Англии. 14 мая 1913 года в гонках по Санкт-Петербургу, на Волхонском шоссе, преодолена скорость 202,1 км/ч. Русская автогонщица Римская-Корсакова разогнала автомобиль до 110 км/ч. Иван Иванов разогнал автомобиль «Руссо-Балт» до 129,7 км/ч.[4]\r\n\r\nБратья Стэнли производили около 1000 автомобилей в год. В 1909 году братья открыли первую в Колорадо гостиницу люкс-класса, и от железнодорожной станции до гостиницы гостей возил паровой автобус, что стало фактическим началом автомобильного туризма. Фирма Stanley выпускала автомобили на паровом ходу до 1927 года. Несмотря на ряд достоинств (хорошая тяга, многотопливность) паровые автомобили сошли со сцены к 1930-м из-за своей неэкономичности и сложностей при эксплуатации.\r\n\r\nНемалый вклад в широкое распространение автомобильного транспорта внёс американский изобретатель и промышленник Г. Форд, с 1913 года внедривший конвейерную систему сборки автомобилей.\r\n\r\nВ 1923 году фирма Бенца изготовила первый грузовой автомобиль с двигателем Дизеля.\r\n\r\n<p><h2><a name="4">Рекорды скорости</a></h2>\r\n\r\n<menu>\r\n\r\n<li>Самая высокая скорость в мире — 1229,78 км/ч на наземном транспортном средстве — реактивном автомобиле Thrust SSC — была показана англичанином Энди Грином 15 октября 1997 г. А средняя скорость по двум заездам составила 1226,522 км/ч. Дорожка длиной 21 километр была размечена на дне высохшего озера в штате Невада (США). Экипаж Грина приводился в движение двумя реактивными двигателями «Роллс-Ройс» общей мощностью 110 тысяч лошадиных сил.\r\n\r\n<li>Самую выcокую cкороcть, которую развила на автомобиле женщина, равна 843,323 км/ч. Её показала в декабре 1976 г. американка Китти Хамблтон на трёхколёcном автомобиле S.М. Мотивейтор, мощноcтью 48 тыc. л.c. в пуcтыне Алвард, штат Орегон, США. По cумме двух заездов в двух направлениях её официальный рекорд равен 825,126 км/ч.\r\n\r\n<li>Немецкое тюнинговое ателье 9ff представило новую информацию и новые фотографии доработанного Porsche GT9-R. Под капотом спорткара установили 1120-сильный мотор. Это официально мощнее, чем Bugatti Veyron с 1001 «лошадью».4,0-литровый турбодвигатель с 6 цилиндрами позволяет разгоняться автомобилю до 100 км/ч за 2,9 секунды. Максимальная скорость 9ff GT9-R — 414 км/ч. Похоже, что это творение тюнеров может претендовать на звание самого быстрого серийного авто в мире, оставив позади SSC Ultimate Aero TT, чья «максималка» составляет 412, 28 км/ч. Правда, не стоит забывать о недавнем мировом рекорде скорости, который установил британский суперкар Keating TKR: под капотом стоит 7,0-литровый мотор мощностью 1 800 л.с. Автомобиль разогнался до 416 км/ч. Для того, чтобы войти в Книгу рекордов Гиннесса, как самый быстрый серийный автомобиль в мире, ему нужно повторить собственный результат. Но в 2010 году Bugatti Veyron опять заняла нишу самого быстрого серийного автомобиля, создав Bugatti Veyron Super Sport увеличив мощность до 1200 сил, теперь её скорость более 431 км/ч.\r\n\r\n<li>Уже вышел (очередной)"наземный истребитель", который, возможно, побъет мировой рекорд скорости. Первые заезды планируют провести в конце 2011 года, в ЮАР хотят достичь скорости в 1609 км/ч. Инженеры завершили испытания реактивного двигателя от истребителя. Суммарная мощность двигателя (вместе с твердотопливным ускорителем) составляет 135 000 л.с.! При длине 12,8 м болид весит 6,5т.\r\n\r\n</menu>\r\n\r\nИнформация взята с сайта <a href="http://ru.wikipedia.org/wiki/Заглавная_страница" target="_blank">Википедия</a>\r\n\r\n<br><br><br>\r\n\r\n<!-- Put this script tag to the <head> of your page -->\r\n\r\n<script type="text/javascript" src="http://userapi.com/js/api/openapi.js?47"></script>\r\n\r\n\r\n\r\n<script type="text/javascript">\r\n\r\n  VK.init({apiId: 2781957, onlyWidgets: true});\r\n\r\n</script>\r\n\r\n\r\n\r\n<!-- Put this div tag to the place, where the Like block will be -->\r\n\r\n<div id="vk_like"></div>\r\n\r\n<script type="text/javascript">\r\n\r\nVK.Widgets.Like("vk_like", {type: "full"});\r\n\r\n</script>\r\n\r\n\r\n\r\n<a target="_blank" class="mrc__plugin_uber_like_button" href="http://connect.mail.ru/share?share_url=http%3A%2F%2Fale-cs-ei.narod.ru%2F" data-mrc-config="{''type'' : ''button'', ''caption-mm'' : ''1'', ''caption-ok'' : ''1'', ''counter'' : ''true'', ''text'' : ''true'', ''width'' : ''100%''}">Нравится</a>\r\n\r\n<script src="http://cdn.connect.mail.ru/js/loader.js" type="text/javascript" charset="UTF-8"></script>\r\n\r\n<br><br><br>\r\n\r\n\r\n\r\n\r\n\r\n<!-- Put this script tag to the <head> of your page -->\r\n\r\n<script type="text/javascript" src="http://userapi.com/js/api/openapi.js?47"></script>\r\n\r\n\r\n\r\n<script type="text/javascript">\r\n\r\n  VK.init({apiId: 2781957, onlyWidgets: true});\r\n\r\n</script>\r\n\r\n\r\n\r\n<!-- Put this div tag to the place, where the Comments block will be -->\r\n\r\n<div id="vk_comments"></div>\r\n\r\n<script type