INSERT INTO `menu_custom` (`menu_name`, `title`, `description`) VALUES
('main-menu', 'Главное меню', 'Меню основных ссылок показывает главные разделы сайта. Обычно выводятся в виде горизонтальной полосы вверху страницы.'),
('management', 'Management', 'Меню управления содержит ссылки на страницы администрирования сайтом.'),
('navigation', 'Навигация', 'Меню навигации создаётся системой и содержит ссылки, предназначенные пользователям. Ссылки добавляются в меню автоматически некоторыми модулями и показываются при наличии соответствующих прав пользователя.'),
('user-menu', 'User menu', 'Меню пользователя содержит ссылки, связанные с учетной записью текущего пользователя, а также ссылку «Выход».');
